    false,nt"url": null,nt"notes": "As of January 1, 2013, the dataset contains
    phenology data on 591 species of plants and animals, with 7,512 locations registered
    across the United States. Protocols used are documented in Denny et. al., Submitted
    (contact nco@usanpn.org for more information). Data were collected using the phenophase
    status approach (Thomas et. al., 2010; Denny et. al. Submitted). Latitude and longitude
    given in WGS84 Datum. This is a suite of yearly data sets (Plants beginning in 2009,
    Animals beginning in 2010) each provided with and without full phenophase definitions.",nt"license_title":
